INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Borderlands: Origins',1,9781613776,'2013/06/04',8,'TRUE','La serie se adentra en los origenes de cada uno de los cuatro cazadores boveda en Borderlands, previo a su llegada a Pandora y embarque Marcus Kincaid bus.',104,'TRUE','Mikey Neumann');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Modern Warfare 2: Ghost',1,9781567776,'2009/01/01',12,'TRUE','El brutal relato del misterioso soldado de asalto conocido como Ghost. Descubre las motivaciones del sargento Riley y su intervencion en conflictos que les llevaran desde el Reino Unido hasta Afganistan',144,'TRUE','David Lapham');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Cyberpunk 2077: Trauma Team',1,9783757776,'2020/09/09',13,'TRUE','Es una historia de guerra, de trastornos de estres, de lealtad, de amor, y tambien de odio y de violencia, de injusticias, pero, sobre todo, es una montana rusa de violencia y disparos.',96,'TRUE','Cullen Bunn');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Deus Ex: Human Revolution ',1,9783759876,'2011/01/01',3,'TRUE','En un futuro no muy distante, la Humanidad se ve amenazada por el imparable avance de la tecnología y los gobiernos opresores que controlan a la ciudadania, asi que nuestro heroe y su arsenal seran la unica salvacion posible.',103,'TRUE','Robbie Morrison');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Gears of war',1,9783759986,'2018/12/18',7,'TRUE','Cerrando la brecha entre Gears of War 1 y 2, sigue las brutales aventuras de Marcus Fenix ??y Delta Squad en la batalla contra las langostas! Descubra lo que sucedio despues del Bombardeo de Masa Ligera y como reaccionaran las langostas a esta devastadora arma.',320,'TRUE','Joshua Ortega');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Gears of war',2,9783759456,'2019/12/17',6,'TRUE','Mientras las Guerras del Pendulo continuan entre la Coalicion de Gobiernos Ordenados y la Union de Republicas Independientes, Marcus Fenix ??y su mano derecha Dominic Santiago se encuentran desplegados en su primera gira militar y deben soportar la dura realidad de la batalla, la perdida y la desaparicion esperanza de victoria.',256,'TRUE','Joshua Ortega');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Gears of war',3,9783759956,'2013/12/10',6,'TRUE','Tras el hundimiento del Jacinto al final del Volumen 2, los Gears han huido a la isla de Vectes, donde luchan por defender los ultimos restos de la humanidad de The Stranded y una nueva amenaza, The Lambent, una forma de vida mortal y mutante.',256,'TRUE','Joshua Ortega');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('God of War: Fallen',1,9783887956,'2021/03/10',2,'TRUE','¿Puede un hombre alguna vez estar libre de su pasado? ¿Podran las mareas del tiempo lavar las arenas sangrientas del pecado? ¿O las transgresiones transpiradas manchan el alma de manera permanente e ineludible? Despues de conquistar a Zeus y frustrar a Atenea, Kratos se cree finalmente libre de su esclavitud.',22,'TRUE','Chris Roberson');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('God of War: Fallen',2,9783927956,'2021/04/12',4,'TRUE','Despues de conquistar a Zeus y frustrar a Atenea, Kratos se cree finalmente libre de su esclavitud. Zarpa hacia el desierto en un intento de distanciarse de su hogar y su vergüenza solo para encontrar que su rabia y culpa lo siguen de cerca.',26,'TRUE','Chris Roberson');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('God of War: Fallen',3,9783347956,'2021/05/05',4,'TRUE','¡Una monstruosa Bestia del Caos amenaza a los temerosos aldeanos del desierto y se enfrenta a Kratos, obligándolo a volver a la batalla! Pero a pesar de su deseo de escapar de su pasado violento, Kratos vuelve a un estado familiar de rabia y furia, lo que desencadena una reacción en cadena de ira interminable por el Fantasma de Esparta.',22,'TRUE','Chris Roberson');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Halo: Fall of Reach',1,9783486796,'2013/01/01',3,'TRUE','El siglo XXVI. La humanidad se ha expandido mas alla del sistema de la Tierra a cientos de planetas que los colonos ahora llaman hogar. Pero el Gobierno de la Tierra Unida y el Comando Espacial de las Naciones Unidas están luchando por controlar este vasto imperio.',23,'TRUE','Brian Reed');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Halo: Fall of Reach',2,9783486796,'2014/12/01',2,'TRUE','El Covenant continua su invasion del planeta Reach, empujando al UNSC a su punto de ruptura, mientras el Jefe Maestro y Cortana luchan por salvar el planeta y la Flota. ¡Este es el capitulo final de la saga Halo: Fall of Reach de Brian Reed y Felix Ruiz!',21,'TRUE','Brian Reed');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Halo: Fall of Reach',3,9783376796,'2015/12/01',2,'TRUE','El Pillar of Autumn y el UNSC se enfrentan a una fuerza masiva del Covenant, mientras el Jefe Maestro y sus compañeros Spartans defienden el planeta Reach. ¡Brian Reed y Felix Ruiz continuan el capitulo final de Halo: Fall of Reach!',24,'TRUE','Brian Reed');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Halo: Helljumper',1,9783455796,'2010/03/10',5,'TRUE','Cuando el planeta colonia Ariel envía una misteriosa senal de socorro, depende de los Helljumpers de la 105a Infantería de Marina comprobarlo, pero pronto dos Helljumpers encuentran su amistad y sus vidas en juego.',120,'TRUE','Peter David');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('The Last of Us American Dreams',1,9783448696,'2013/10/29',12,'TRUE','Hace diecinueve anos, un brote de parasitos fungicos mato a la mayoria de la poblacion del planeta. Ellie, de trece anos, que vive en una de las pocas zonas que permanecen en cuarentena, comienza una nueva vida en un internado militar.',96,'TRUE','Faith Erin Hicks');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Castlevania: The Belmont Legacy',1,9783877696,'2005/03/09',5,'TRUE','La terrorifica sombra de Dracul el Empalador amenaza de nuevo con acabar con la paz en los poblados de Rumania.',112,'TRUE','Mark Adreyko');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('The Legend of Zelda comics: Ocarina of Time',1,9783877236,'2009/09/03',10,'TRUE','Link vive en el bosque Kokiri hasta que su mentor, el Gran Arbol Deku, le envia al mundo exterior antes de morir. El joven aventurero debe encontrar a la princesa Zelda, que le hablara de la Trifuerza y de la ocarina del tiempo',192,'TRUE','Akira Himekawa');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('The Legend of Zelda comics: Majora s Mask',1,9783567236,'2012/09/28',6,'TRUE','Link esta buscando a Navi, la pequena hada que lo acompano en su lucha para salvar Hyrule. Pero por culpa de Skull Kid y de la mascara que lo ha poseido, nuestro joven heroe acaba en la ciudad de Termina, que esta a punto de desaparecer',208,'TRUE','Akira Himekawa');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('The Legend of Zelda comics: Oracle of Seasons',1,9783567976,'2011/02/25',14,'TRUE','La Trifuerza transporta a Link, el heroe del tiempo, a la tierra de Holodrum, donde se encuentra con la hermosa bailarina Din, tambien conocida como el “oraculo de las estaciones”.',388,'TRUE','Akira Himekawa');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('The Legend of Zelda comics: Four swords',1,9783567656,'2017/07/11',9,'TRUE','La historia comienza con Link, que, junto a su padre, son parte de la Guardia Real de Hyrule, sin embargo, Link odia trabajar en equipo y esto causa que el padre de Link pida ayuda a la Princesa Zelda, amiga de la infancia de Link.',370,'TRUE','Akira Himekawa');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Sonic the Hedgehog/Mega Man: Worlds unite',1,9783565456,'2015/04/13',9,'TRUE','Dark forces have come together in the far future! The vicious conqueror Sigma has cheated death again and escaped the justice of X and the Maverick Hunters.',136,'TRUE','Ian Flynn');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Sonic / Mega Man: Worlds Collide',1,9783569215,'2013/12/20',10,'TRUE','¡La epica de Sonic the Hedgehog / Mega Man comienza con una explosion en el primero de los tres volumenes cuando Blue Blur y Blue Bomber se encuentran por primera vez!',104,'TRUE','Ian Flynn');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Dark Souls II: Into the Light',1,9783564829,'2014/01/08',6,'TRUE','Hace mucho, en una tierra amurallada, muy lejos del norte, un gran rey construyo un gran reino. Creo lo que llamaban Drangleic. Un lugar donde las almas curan tu mente enferma. Seras algo más que humano.',24,'TRUE','Rob Williams');
INSERT INTO comic (titulo,volumen,numero,fecha_publicacion,precio_publicacion,color,sinopsis,paginas,cubierta,editor) VALUES ('Tekken Comic',1,9783564832,'2009/10/19',5,'TRUE','Jin Kazama, el dueno de la poderosa corporación japonesa Mishima Zaibatsu, declara la guerra al mundo entero. Las naciones que se pusieron del lado de la corporacion se fusionaron en una nacion independiente, destruyendo cualquier oposicion.',112,'TRUE','Rui Takato');
